    */
  };

  return (
    <div className={css.card}>
      
      <h3>{title}</h3>
      
        <p>
        { description }
        </p>
      
      <div className={css.date}>{ date }</div>
      <div className={css.btn}>
        ‚ùå
      </div>
    </div>
  );
}
